import React from 'react'
import '../styles/SearchCard.css';

export default class SearchCard extends React.Component {
    render(){
        const charityId = () => {
            const charities = this.props
            charities.find(charity => charity.id === this.props.id)
        }

        return(
            <div id="searchCard" onClick={charityId}>
               {this.props.charity_name}
            </div>
        )
    }
}
